import logo from './logo.svg';
import './App.css';

import Read from './post/PageLoad'; 
import Post from './post/PagePost';


function App() {
  return (
    <div className="App">
      App 화면 띄우는 중 
      import Read from './post/PageLoad'; 
import Post from './post/PagePost';
      <Route path="/blog/:fileName" element ={<Read/>} 
      />
    </div>
  );
}

export default App;
